# (387894661 - 387273515) / 5791 = 107.26
# Adjusted from 108 to 107.5 when there was a measured slip of 5m over 13h.
# At 2024-03-25 4:29:20 AEDT, I predicted a nut frame
# at 2024-04-02 4:10:40 AEDT. (191h41m20s)
# Actual 2024-04-02 4:25:51 AEDT
# 15m51s = 951s
# 191h41m20s = 690080s
# 107.5 is off by .14% ~= 0.148
AVERAGE_ADVANCES_PER_SECOND = 107.4

TID = 27171
SID = 33452

ILLUMINATE = True
CAVE = True
SURF = False
WHITE_FLUTE = True
DENSITY = 320
if (ILLUMINATE):
    DENSITY *= 2
if (CAVE):
    DENSITY /= 2
if (SURF):
    DENSITY /= 5
if (WHITE_FLUTE):
    DENSITY *= 1.5


def FindShinySeeds():
    seeds = []
    for j in range(1 << 16):
        top = j
        # Species check
        # 99 = Seedot (slot 12)
        # 98 = Volbeat (slot 11)
        # [94,98) = Ralts (slot 10))
        if top % 100 < 98:
            continue
        for i in range(1 << 16):
            seed = (top << 16) + i
            encSeed = rng.reverseRng(seed, 1)
            # Needs to be an encounter
            if rng.top(encSeed) % 2880 >= DENSITY:
                continue
            poke = rng.WildPokemon(rng.advanceRng(seed, 2))
            shiny = (poke.pid >> 16) ^ (poke.pid & 0xFFFF) ^ TID ^ SID
            if shiny < 8:
                print("nut", seed)
                seeds.append(seed)
    # for i in range(1 << 16):
    #     top = i
