def FindShinyIndecies(seeds):
    indecies = []
    for seed in seeds:
        indecies.append(rng.index(seed))
    indecies.sort()
    print(indecies)


def FindAllEncountersForPID(PID, seed):
    # The sed passed in is the seed of the upper bits, but it's easier to code
    # the loop if we reverse once so it's the seed of the lower bits.
    seed = rng.reverseRng(seed, 1)
    # The game first creates a tentative PID, then generates PIDs until it
    # matches, so let's get the nature it was matching.
    nature = PID % 25
    # And then we can play RNG backward from the seed until we see RNG that
    # would have generated a tentative PID with the same nature.
    encounters = []
    tentativePid = nature + 1
    # If the tentattive PID ever matches the nature, it would have been chosen
    # instead of proceeding to the PID we know about, so we can end the loop.
    while ((tentativePid % 25) != nature):
        seed = rng.reverseRng(seed, 1)
        upper = rng.top(seed)
        if ((upper % 25) == nature):
            # This would be a valid place for the encounter to have generated
            # this PID.  Reversing rng 3 times gets us to the RNG of the
            # encounter determination, which lets us verify this is a valid
            # encounter.
            encRng = rng.reverseRng(seed, 3)
            if (rng.top(encRng) % 2880 < DENSITY):
                # Go one forward to get to the encounter slot determintation,
                # which makes things a bit easier for callers.
                encounters.append(rng.advanceRng(encRng, 1))
        # So since this wasn't the nature generating call, this was a tentative
        # PID call so we also have to burn the RNG that set the lower bits for
        # it.
        seed = rng.reverseRng(seed, 1)
        lower = rng.top(seed)
        tentativePid = (upper << 16) + lower
    # Note that this doesn't account for Synchronize.
    return encounters


def FindPossibleIndeciesForPID(PID):
    indecies = []
    upper = PID >> 16
    lower = PID & 0xFFFF
    for i in range(1 << 16):
        seed = (lower << 16) + i
        seed = rng.advanceRng(seed, 1)
        if rng.top(seed) == upper:
            seeds = FindAllEncountersForPID(PID, seed)
            # A fallback in case finding encounters fails.
            if (len(seeds) == 0):
                print("valid PID with no seeds at index", rng.index(seed))
            indecies.extend(map(lambda x: rng.index(x), seeds))
    return indecies


def NearestShiny(index, ShinyIndex):
    # TODO: binary search?
    for possible in ShinyIndex:
        if possible >= index:
            return possible
    return ShinyIndex[0]  # wrap around.


def _time(advances):
    seconds = advances / AVERAGE_ADVANCES_PER_SECOND
    minutes = seconds // 60
    seconds = seconds % 60
    hours = minutes // 60
    minutes = minutes % 60
    return "%dh %dm %fs" % (hours, minutes, seconds)


# TODO: better configurability for this as we move to different routes.
SLOTS = {
    0: "POOCH 13",
    20: "ODD 13",
    40: "POOCH 14",
    50: "ODD 14",
    60: "MAR 13",
    70: "ODD 13",
    80: "ILL 13 (1st)",
    85: "ILL 13 (2nd)",
    90: "ILL 14 (1st)",
    94: "ILL 14 (2nd)",
    98: "VOLB 13",
    99: "DOT 13",
}


def Slot(rng):
    s = rng % 100
    slot = ""
    for key in SLOTS:
        if s >= key:
            slot = SLOTS[key]
    return slot


def Closest(PID, ShinyIndex, name):
    for index in FindPossibleIndeciesForPID(PID):
        mon = NearestShiny(index, ShinyIndex)
        print(name, mon, "index", index)
        slotRng = rng.advanceRng(0, index)
        print("slot", Slot(rng.top(slotRng)))
        print(_time(mon - index))

def ClosestNut(PID):
    Closest(PID, SHINY_INDEX, "nut")
    
def ClosestPlusle(PID):
    Closest(PID, SLOT_12_ILL_INDEX, "+")
    Closest(PID, SLOT_11_ILL_INDEX, "+")
    
def ClosestAll(PID):
    for index in FindPossibleIndeciesForPID(PID):
        nut = NearestShiny(index, SLOT_12_ILL_INDEX)
        print("nut", nut, "index", index)
        print(_time(nut - index))
        bug = NearestShiny(index, SLOT_11_ILL_INDEX)
        print("bug", bug, "index", index)
        print(_time(bug - index))
        slotRng = rng.advanceRng(0, index)
        print("slot", Slot(rng.top(slotRng)))


def Forecast(index, duration=604800, shinyIndex=None):
    """duration in seconds"""
    if shinyIndex is None:
        shinyIndex = SHINY_INDEX
    adv = duration * AVERAGE_ADVANCES_PER_SECOND
    seeds = filter((lambda x: x > index and x < (index + adv)), shinyIndex)
    i = 0
    for seed in seeds:
        print(_time(seed-index))
        i += 1
    print("total:", i)


class State():
    
    def __init__(self):
        self.latestTime = timeLib.time()
        self.possibleIndecies = []
        self.relevantIndex = {
            'grime': GRIME_TIME_INDEX
        }
        
    def AddPID(self, PID):
        indecies = FindPossibleIndeciesForPID(PID)
        if not self.possibleIndecies:
            self.possibleIndecies = indecies
            self.latestTime = timeLib.time()
        else:
            newPossibleIndecies = []
            for oldIndex in self.possibleIndecies:
                index, time = self._findIndexMatch(oldIndex, indecies)
                if time != 0:
                    newPossibleIndecies.append(index)
                    self.latestTime = time
            if newPossibleIndecies:
                self.possibleIndecies = newPossibleIndecies
            else:
                print('debug: did not find any extensions of previous pids')
                    
    
    def _findIndexMatch(self, oldIndex, indecies):
        """Reads but does not update state"""
        now = timeLib.time()
        for newIndex in indecies:
            diff = newIndex - oldIndex
            if diff < 0:
                # Can't go backwards. Doesn't work for the wrap around, but I'm
                # not concerned about that right now
                continue
            expectedDuration = diff / AVERAGE_ADVANCES_PER_SECOND
            lowerBound = self.latestTime + 0.8*expectedDuration
            upperBound = self.latestTime + 1.2*expectedDuration
            if now < lowerBound or now > upperBound:
                continue
            return (newIndex, now)
        return (0, 0)
    
    def _getNowIndex(self, fromIndex, fromTime):
        return math.floor(fromIndex + (timeLib.time() - fromTime) * AVERAGE_ADVANCES_PER_SECOND)
    
    def _forecastAmount(self, fromIndex, fromTime, inIndex, amount):
        nowIndex = self._getNowIndex(fromIndex, fromTime)
        startPosition = 0
        for i in range(len(inIndex)):
            if inIndex[i] > nowIndex:
                startPosition = i
                break
        seeds = []
        for j in range(startPosition, startPosition+amount):
            position = j
            # wrap around in case we're at the end.
            if position >= len(inIndex):
                position -= len(inIndex)
                seeds.append(inIndex[position] + 1 << 32)
            else:
                seeds.append(inIndex[position])
        return seeds
                
        
    def _forecastDuration(self, fromIndex, fromTime, inIndex, duration):
        # TODO: account for time of last stated pid versus time now
        nowIndex = self._getNowIndex(fromIndex, fromTime)
        adv = duration * AVERAGE_ADVANCES_PER_SECOND
        seeds = filter((lambda x: x > fromIndex and x < (nowIndex + adv)), inIndex)
        i = 0
        for seed in seeds:
            print(_time(seed-nowIndex), "(", seed, ")")
            i += 1
        print("total:", i)
    
    def ForecastOne(self):
        # Intentionally not manipulating the reported index to now
        for index in self.possibleIndecies:
            print("from index:", index)
            for mon in self.relevantIndex:
                shinies = self.relevantIndex[mon]
                mons = self._forecastAmount(index, self.latestTime, shinies, 1)
                for m in mons:
                    print(mon, m, "in", _time(m-index))
            # slotRng = rng.advanceRng(0, index)
            # print("slot", Slot(rng.top(slotRng)))
            
    def _forecastTime(self, duration):
        if len(self.possibleIndecies) > 1:
            print("add more pids to narrow down the scope")
        index = self.possibleIndecies[0]
        for mon in self.relevantIndex:
            print(mon + "s:")
            self._forecastDuration(index, self.latestTime, self.relevantIndex[mon], duration)
        
    def ForecastWeek(self):
        self._forecastTime(604800)
        
    def ForecastDay(self):
        self._forecastTime(84600)
        
    def _nextShiny(self, shinyIndex):
        if not self.possibleIndecies:
            return 0
        for shiny in shinyIndex:
            if shiny > self.possibleIndecies[0]:
                return shiny
        return shinyIndex[0]
        
    def DiffToNext(self, shinyIndex):
        # Prints the number of rng advances between the last encounter and the
        # next shiny
        if not self.possibleIndecies[0]:
            return -1
        return self._nextShiny(shinyIndex) - self.possibleIndecies[0]
    
    def _prevShiny(self, shinyIndex):
        if not self.possibleIndecies:
            return 0
        last = shinyIndex[-1]
        for shiny in shinyIndex:
            if shiny < self.possibleIndecies[0]:
                last = shiny
            else:
                return last
    
    def DiffToPrev(self, shinyIndex):
        # Prints the number of rng advances between the last encounter and the
        # previous shiny
        if not self.possibleIndecies[0]:
            return -1
        return self.possibleIndecies[0] - self._prevShiny(shinyIndex)
        

def CLI():
    state = State()
    while True:
        command = input('> ')
        tokens = command.split(' ')
        if tokens[0] == 'exit':
            break
        elif tokens[0] == 'reset':
            state = State()
        elif tokens[0] == 'pid':
            # Check tokens[1] exists and is parseable to an int
            if len(tokens) < 2:
                print ('needs an integer pid (i.e. > pid 0x1337beef)')
            try:
                toParse = tokens[1]
                radix = 10
                if toParse.startswith('0x'):
                    radix = 16
                pid = int(tokens[1], radix)
                state.latest_pid = pid
            except:
                print ('needs an integer pid (i.e. > pid 0x1337beef)')
            # Then find index, update current pid/time
            state.AddPID(pid)
        elif tokens[0] == 'forecast':
            if len(tokens) > 1:
                if tokens[1] == 'week':
                    state.ForecastWeek()
                if tokens[1] == 'day':
                    state.ForecastDay()
            else:
                state.ForecastOne()
        elif tokens[0] == 'diff':
            if len(tokens) < 3:
                print('Not enough arguments.  Expecting `diff [ next | prev ] [ bug | nut]')
            # translate last token into a shiny index
            shinyIndex = []
            if tokens[2] == 'bug':
                shinyIndex = SLOT_12_ILL_INDEX
            if tokens[2] == 'nut':
                shinyIndex = SLOT_11_ILL_INDEX
            # then translate 2nd token into the command
            diff = -1
            if tokens[1] == 'next':
                diff = state.DiffToNext(shinyIndex)
            if tokens[1] == 'prev':
                diff = state.DiffToPrev(shinyIndex)
            print(diff)
        else:
            print("not a valid command")


